mscAppnDnaOutDefaultPathSensitivity = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 110, 2, 12, 1, 11), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("throughput", 0), ("delay", 1))).clone('throughput')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscAppnDnaOutDefaultPathSensitivity.setStatus('obsolete')
if mibBuilder.loadTexts: mscAppnDnaOutDefaultPathSensitivity.setDescription('This attribute specifies the default class of routing for delay/ throughput sensitive routing for all outgoing calls (from the DTE to the network) using this particular Dna. The chosen default class of routing applies to all outgoing calls established using this Dna, and applies to the packets travelling in both directions on all outgoing calls (local to remote, and remote to local). For incoming calls, the default class of routing is chosen by the calling party (as opposed to DPN, where either end of the call can choose the default routing class). This attribute, if set to a value of throughput, indicates that the default class of routing is throughput sensitive routing. If set to a value of delay, then the default class of routing is delay sensitive routing. In the future, the class of routing sensitivity may be overridden at the calling end of the call as follows: The default class of routing sensitivity can be overridden by the DTE in the call request packet through the TDS&I (Transit Delay Selection & Indication) facility if the DTE supports this facility. Whether or not the DTE is permitted to signal the TDS&I facility will depend on the DTE (i.e.: TDS&I is supported in X.25 only), and will depend on whether the port is configured to permit the TDS&I facility. In Passport, the treatment of DTE facilities (for example, NUI, RPOA, and TDS&I) is not fully defined yet since it is not required. At the point in time when it is required, the parameter to control whether or not the DTE is permitted to signal the TDS&I will be in a Facility Treatment component. Currently, the default is to disallow the TDS&I facility from the DTE.')
